function out = ode_prlgrm_rev
out{1} = @init;
out{2} = @fun_eval;
out{3} = @jacobian;
out{4} = @jacobianp;
out{5} = @hessians;
out{6} = @hessiansp;
out{7} = @der3;
out{8} = @der4;
out{9} = @der5;

% --------------------------------------------------------------------------
function dydt = fun_eval(tau,kmrgd,par_a,par_b,par_t,par_gam)
c=par_gam*2*par_t^par_gam+par_gam*1/2*par_t^par_gam+2*par_t^2;
z=(c-par_gam*kmrgd(1)-par_gam*kmrgd(2))/2;
dydt=[(kmrgd(2)*z^par_gam-kmrgd(1)*kmrgd(2)^2)/c;
(-kmrgd(2)*z^par_gam+kmrgd(1)*kmrgd(2)^2+2*par_a*kmrgd(1)*z^par_gam-2*4*par_a*kmrgd(1)*kmrgd(2)^2-2*4*par_b*kmrgd(2)^3+2*par_b*kmrgd(2)*z^par_gam)/c;];

% --------------------------------------------------------------------------
function [tspan,y0,options] = init
handles = feval(ode_prlgrm_rev);
y0=[0,0];
options = odeset('Jacobian',handles(3),'JacobianP',handles(4),'Hessians',handles(5),'HessiansP',handles(6));
tspan = [0 10];

