_a*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^par_gam - 2*kmrgd(2)*par_b*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^par_gam + 8*kmrgd(1)*kmrgd(2)^2*par_a))/((5*par_t^par_gam*par_gam)/2 + 2*par_t^2)^2 ];
