hess2=[ -(2*kmrgd(2) + (par_gam^2*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 1))/2 - (kmrgd(2)*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/4)/((5*par_t^par_gam*par_gam)/2 + 2*par_t^2) , -(2*kmrgd(1) + par_gam^2*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 1) - (kmrgd(2)*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/4)/((5*par_t^par_gam*par_gam)/2 + 2*par_t^2) ; (2*kmrgd(2) + (par_gam^2*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 1))/2 - 16*kmrgd(2)*par_a - par_a*par_gam^2*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 1) - par_b*par_gam^2*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 1) - (kmrgd(2)*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/4 + (kmrgd(1)*par_a*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/2 + (kmrgd(2)*par_b*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/2)/((5*par_t^par_gam*par_gam)/2 + 2*par_t^2) , (2*kmrgd(1) + par_gam^2*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 1) - 16*kmrgd(1)*par_a - 48*kmrgd(2)*par_b - 2*par_b*par_gam^2*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 1) - (kmrgd(2)*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/4 + (kmrgd(1)*par_a*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/2 + (kmrgd(2)*par_b*par_gam^3*(par_gam - 1)*((5*par_t^par_gam*par_gam)/4 - (kmrgd(1)*par_gam)/2 - (kmrgd(2)*par_gam)/2 + par_t^2)^(par_gam - 2))/2)/((5*par_t^par_gam*par_gam)/2 + 2*par_t^2) ];
